import axios from "axios";

const api = axios.create({
  baseURL: "https://api.themoviedb.org/3/",
  params: {
    api_key: "78a7cd8680a353320b7a14d1d0fd41ed",
    language: "en-US",
  },
});

api.get("tv/popular");

export default api;
